                //compteur++;
                sol_row_temp=new int[rounds];
                sol_col_temp=new int[rounds];
                // On choisit les cases restantes au hasard
                for (int i=0;i<etape;i++)  {
                    sol_row_temp[i]=sol_row[i];
                    sol_col_temp[i]=sol_col[i];
                }
