                score=rounds;
                for (int turn=0;turn<longueur;turn++){
                    // On change la couleur de la case o elle est
                    if (grille[fourmi[0]][fourmi[1]]==0){// Si la case est vide
                        fourmi[2]=(fourmi[2]+3)%4;// On fait tourner la fourmi
                        grille[fourmi[0]][fourmi[1]]=1; // On colorie la case
                        score++;
