                    sol_row=sol_row_temp;
                    sol_col=sol_col_temp;
                    score_max=score;
                }
            }
            //System.err.println(compteur);
            System.out.println(String.format("%d %d", sol_row[etape], sol_col[etape]));
            etape++;
        }
    }

    private static boolean est_dedans(int[] rows, int[] cols, int row, int col)
    {
        for(int i=0;i<rows.length;i++)
        {
            if(rows[i]==row && cols[i]==col)
            {
                return true;
            }
        }
        return false;
    }
}

